Name:       Marlene  
Country:    France 
Weight:     43kg 
Height:     168cm 
Age:        24 
Occupation: Student 


Confident, charismatic and extremely self-assured Marlene is the kind of girl who knows exactly where shes headed and what she wants from life.
With her striking looks it would be easy to think that Marlene is just another pretty face. But that would be underestimating her by a long way. Quite an incredible girl, she is currently in her 6th year at university. Marlene is studying for her Masters degree in psychology, specializing in the area of trauma.
As a model Marlene proved to be an excellent poser, she moves like a cat and wasnt shy at all. She is ultra-petite weighing only 43 kilos and her wardrobe consists solely of Japanese designer clothes, as these are perfect for her tiny frame. She favors clothes in lace and other luxurious fabrics and has her own unique style.

Very aware of her own sexuality and presence, Marlene is a rare combination of intelligence and allure.
